import { StatusBar } from 'expo-status-bar';
import {View, Image, ImageBackground, StyleSheet, Text, TextInput, Alert, ScrollView} from 'react-native'; 
import {RectButton} from 'react-native-gesture-handler'; 
import {useNavigation} from '@react-navigation/native'; 

export default function ParticiparGrupo() {

  const navigation = useNavigation(); 


  function handleNavigationToHome() {
    navigation.navigate('Home');
  }

  return (
    <View style={styles.container}>

      <ImageBackground source={require('../../assets/images/fundo-login.png')}
       style={styles.imgFundo}>
        <View style={styles.bodyPartGrupo}>

        <View style={styles.topoPartGrupo}>
          <Text style={styles.tituloDados}>Dados do Grupo</Text>
          <Image style={styles.imgGrupo} source={require('../../assets/images/gwen.png')}/>
          <Text style={styles.tituloGrupo}  numberOfLines={1}>Os grandes construtores</Text>
        </View>

      <View style={styles.menu}>
        <RectButton style={styles.btnMenu}  onPress={handleNavigationToHome}> 
          <Image style={styles.imgMenu} source={require('../../assets/images/home.png')}/>
        </RectButton> 
        <RectButton style={styles.btnMenu}> 
          <Image style={styles.imgMenu} source={require('../../assets/images/chat.png')}/>
        </RectButton> 
        <RectButton style={styles.btnMenu}> 
          <Image style={styles.imgMenu} source={require('../../assets/images/notificacao.png')}/>
        </RectButton> 
        <RectButton style={styles.btnMenu}> 
          <Image style={styles.imgMenu} source={require('../../assets/images/perfil-ativo.png')}/>
        </RectButton> 
      </View>
        </View>


     </ImageBackground>

    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },

  button:{
    width:120,
    height: 45, 
    backgroundColor: '#7EDD2A', 
    display:'flex',
    alignItems:'center',
    justifyContent:'center',
    borderRadius: 10, 
    marginBottom: 8, 
    marginTop: 8, 
    paddingHorizontal: 24, 
    fontSize: 16, 
  },

  buttonText:{
    fontWeight:'bold',
    fontSize:17,
    color:'#FFF'
  },

  imgFundo: {
    flex:1,
    width: '100%',
    justifyContent:'space-between',
    alignItems:'center',
    backgroundColor:'#3956FF',
    borderBottomLeftRadius:50,
    borderBottomRightRadius:50,
  },

  titulo:{
    color:'#474747',
    fontSize:25,
    fontWeight:'bold'
  },

  tituloDados:{
    color:'#474747',
    fontSize:22,
    fontWeight:'bold',
    width:'90%'
  },

  tituloGrupo:{
    color:'#3956FF',
    fontSize:25,
    fontWeight:'bold'
  },

  topoPartGrupo:{
    display:'flex',
    alignItems:'center',
    justifyContent:'space-around',
    marginTop:40
  },

  imgGrupo:{
    width:120,
    height:120,
    borderRadius:110,
  },

  txtTitulo:{
    color:'#474747',
    fontSize:20,
    fontWeight:'bold',
    marginTop:5
  },

  bodyPartGrupo:{
    backgroundColor:'#FFF',
    width:'100%',
    height:'100%',
    marginTop:60,
    borderRadius:40,
    display:'flex',
    alignItems:'center',
    justifyContent: 'space-between',
    paddingBottom:60
  },

  menu:{
    display:'flex',
    justifyContent:'space-around',
    height:69,
    backgroundColor:'#FFF',
    width:'100%',
    flexDirection: 'row',
    alignItems:'center',
    borderTopLeftRadius:30,
    borderTopRightRadius:30,
    shadowColor: "#000000",
    shadowOffset: {
      width: 0,
      height: 18,
    },
    shadowOpacity:  0.25,
    shadowRadius: 20.00,
    elevation: 24
  },

  btnMenu:{
    display:'flex',
    alignItems:'center',
    justifyContent:'center'
  }


});
